INSERT INTO `pages_translations` VALUES (1,1,4,'Welcome!','Let\'s get started','Physical activity is essential for healthy child development, yet 80% of youth are not active enough and we lack information about activity levels of young children.'),(2,1,2,'Bienvenido!','Empecemos!','La actividad fsica es esencial para el desarrollo saludable de los nios, sin embargo, el 80% de los jvenes no son lo suficientemente activos y carecemos de informacin sobre los niveles de actividad de los nios pequeos.'),(3,1,3,'Bienvenue !','Commenons!','L\'activit physique est essentielle pour le dveloppement sain de l\'enfant, pourtant 80 % des jeunes ne sont pas assez actifs et nous manquons d\'informations sur les niveaux d\'activit des jeunes enfants.'),(4,2,4,'gacpaq','Continue','Our goal is to address the lack of information on activity levels, particularly among young children, and the limitations of current questionnaires that neglect certain types of physical activity. By collecting data on active play, we can compare activity levels within and between countries to identify effective strategies for promoting physical activity. Our study involves expert and public reviews, translations, pilot studies, and a large-scale data collection across diverse urban and rural areas. By comparing our questionnaire data with movement sensors, we aim to create a more accurate global measurement of physical activity, contributing to healthier lifestyles worldwide.'),(5,2,2,'gacpaq','Seguir','Nuestro objetivo es abordar la falta de informacin sobre los niveles de actividad, especialmente entre los nios pequeos, y las limitaciones de los cuestionarios actuales que descuidan ciertos tipos de actividad fsica. Al recopilar datos sobre el juego activo, podemos comparar los niveles de actividad dentro y entre pases para identificar estrategias efectivas para promover la actividad fsica. Nuestro estudio involucra revisiones de expertos y del pblico, traducciones, estudios piloto y una amplia recopilacin de datos en diversas reas urbanas y rurales. Al comparar nuestros datos del cuestionario con sensores de movimiento, aspiramos a crear una medicin global ms precisa de la actividad fsica, contribuyendo a estilos de vida ms saludables en todo el mundo.'),(6,2,3,'gacpaq','Continuer','Notre objectif est de remdier au manque d\'informations sur les niveaux d\'activit, notamment chez les jeunes enfants, ainsi que les limites des questionnaires actuels qui ngligent certains types d\'activit physique. En collectant des donnes sur le jeu actif, nous pouvons comparer les niveaux d\'activit au sein des diffrents pays pour identifier des stratgies efficaces de promotion de l\'activit physique. Notre tude comprend des valuations d\'experts et du public, des traductions, des tudes pilotes et une collecte de donnes  grande chelle dans diverses zones urbaines et rurales. En comparant nos donnes de questionnaire avec des capteurs de mouvement, nous visons  crer une mesure mondiale plus prcise de l\'activit physique, contribuant ainsi  des modes de vie plus sains  l\'chelle mondiale.'),(7,3,4,'Great Job','Let\'s get started',NULL),(8,3,2,' Excelente trabajo!','Comencemos!',NULL),(9,3,3,'Excellent travail','Commenons!',NULL);
/*!40000 ALTER TABLE `pages_translations` ENABLE KEYS */;
UNLOCK TABLES;

